    <script>
      (function () {
        var gears = document.getElementsByClassName("preloader-center");
        var gearsWrapper = document.getElementsByClassName(
          "preloader-center-wrapper"
        );
        if (!gears) return;
        function scaleGears() {
          for (let gear of gears) {
            gear.style.display = "block";
          }
          var w = window.innerWidth;
          var h = window.innerHeight;
          var scale = Math.min((w * 0.45) / 370, (h * 0.3) / 320, 1);
          for (let gearWrapper of gearsWrapper) {
            gearWrapper.style.transform =
              "scale(" + scale + ") translate(-50%, 0%) rotate(-7deg)";
          }
        }

        scaleGears();
        window.addEventListener("resize", scaleGears);
      })();
    </script>
